window.bookSummaryJSON = "<p>We're a match made in hell, Stefan and I.</p> <p>He took me to exact his revenge. I went from being a pawn to my father to being a pawn to Stefan. The only difference is I have a ring the size of a boulder on my finger and a husband I don't want.</p> <p>And the hardest part is I thought he was different. I thought I was falling in love.</p> <p>I guess my father was right. I'm not a very smart girl.</p> <p>Stefan is a powerful man. He doesn't play nice, not if you're his enemy. But I've learned one thing about my husband.</p> <p>He takes care of what's his. <br> And I am his.</p> <p>His enemies have become my enemies, but he'll never let anyone hurt me. He's fiercely protective. It's the predator inside that scares me.</p>"; 
